import React, { Component } from "react";
import CardList from "../components/CardList";
import "./App.css";
import PostList from "../components/Post/PostList";
class App extends Component {
  constructor() {
    super();
    this.state = {
      robots: []
    };
  }
  render() {
    return (
      <div>
        <PostList />
        <CardList />
      </div>
    );
  }
}
export default App;
